import React, {Component} from 'react';
import StudiesService from "../services/DicomService";
import PatientsTable from '../components/PatientsTable';


//初始化需要再此页面显示表格的数组  
const show=[];
class PatientsPage extends Component {
    constructor(props) {
        super(props);
        this.state = {
            studies: [],
            showList: [],
        };
        this.setState.bind(this);
    }


    componentWillMount() {

        console.log("开始获取studies")
        StudiesService.findPatients(studyList => {
            console.log("找到studies了 如下")
            console.log(studyList);
            studyList.map(study => {
                show.push({
                    patient_name: study.patient_name,
                    patient_id: study.patient["patient_id"],
                    patient_gender: study.patient["patient_sex"],
                    patient_birthdate: study.patient["patient_birthdate"],
                    patient_age: study.patient["patient_age"],
                    image_count: study.patient["patient_count"],
                })
            });
            this.setState({
                studies: studyList,
                showList: show})
        });


    }

    render() {
        const studies = this.state.studies;    
        return (
            <div>
                <h1>Patients</h1>
                <PatientsTable data={this.state.showList}/>
            </div>
        )
    }
}


export default PatientsPage;
